import React from 'react'
import styled from 'styled-components';

const Ul = styled.ul`
    list-style: none;
    display: flex;
    flex-flow: row nowrap;

    li {
      padding: 18px 10px;   
    }

    @media (max-width: 768px) {
        display:none;
        flex-flow: column nowrap;
        background-color: #002538;
        position: flexed;
        transform: ${({open}) => open ? 'translateX(0)' : 'translateX(100%)'};
        top: 0;
        height:100vh;
        width: 300px;
        padding-top: 3.5rem;

        li {
            color: #fff;
        }
    }
`

const RightNav = () => {
    return (
       <Ul>
        <li>Home</li>
        <li>About us</li>
        <li>Contact Us</li>
        <li>Sign In</li>
        <li>Sign Up</li>
      </Ul>
    )
}

export default RightNav
